import{_ as e}from"./chunks/PageInfo.vue_vue_type_script_setup_true_lang.CSBJqdyJ.js";import{_ as o,c as s,I as r,j as a,a as i,a6 as l,o as n}from"./chunks/framework.DrBMTUlI.js";const T=JSON.parse('{"title":"三中高皇羊肉馆","description":"","frontmatter":{"author":"Clo0oOoud"},"headers":[],"relativePath":"Play/Eat/OutSchool/GuLou/三中高皇羊肉馆.md","filePath":"Play/Eat/OutSchool/GuLou/三中高皇羊肉馆.md","lastUpdated":1721287259000}'),c={name:"Play/Eat/OutSchool/GuLou/三中高皇羊肉馆.md"},_=a("h1",{id:"三中高皇羊肉馆",tabindex:"-1"},[i("三中高皇羊肉馆 "),a("a",{class:"header-anchor",href:"#三中高皇羊肉馆","aria-label":'Permalink to "三中高皇羊肉馆"'},"​")],-1),p=l('<h2 id="位置" tabindex="-1">🔍 位置 <a class="header-anchor" href="#位置" aria-label="Permalink to &quot;:mag: 位置&quot;">​</a></h2><p>鼓楼区民主北路 37 号（近苏宁）</p><p><img src="https://s2.loli.net/2024/07/18/HxgKVUZqz6sb87O.png" alt="image-20240718000828843" class="mx-auto w-80%"><br></p><h2 id="🌰-食评" tabindex="-1">🌰 食评 <a class="header-anchor" href="#🌰-食评" aria-label="Permalink to &quot;🌰 食评&quot;">​</a></h2><p>点了招牌蘸羊肉</p><p>羊肉很新鲜，大块肉一口一块，肉食党吃的很过瘾，处理的很好没有羊膻味，既瘦的也有肥瘦相间的，蘸料里有洋葱、花椒、辣椒、葱段之类的增添了咸鲜，调和风味的同时也不抢了羊肉的肉香，一开始只觉着香，吃到后面辣味就上来了，但可以接受，有点像吃火锅涮完了肉再沾蘸料的味道，不错，下酒吃也可，作为主菜前菜吃也可，观察了一下馆子里菜的份量很足。</p><h2 id="tips" tabindex="-1">💁‍♂️Tips <a class="header-anchor" href="#tips" aria-label="Permalink to &quot;:tipping_hand_man:Tips&quot;">​</a></h2><p>需要自己找空位置、拿菜单自己去结账处点菜，先付款后上菜，饭点人很多，难停车。</p><p><img src="https://s2.loli.net/2024/07/18/Mu8VltcOenUx7rI.png" alt="image-20240718000850393" class="mx-auto w-80%"><br></p><p><img src="https://s2.loli.net/2024/07/18/gxFcek98uJtUyhO.png" alt="image-20240718000852575" class="mx-auto w-80%"><br></p>',10);function d(h,m,u,f,g,x){const t=e;return n(),s("div",null,[_,r(t,{readTime:"1",words:"265"}),p])}const O=o(c,[["render",d]]);export{T as __pageData,O as default};
